window.bookSummaryJSON = "<p>Would you risk your eternal soul to save your one true love?</p> <p>Drake didn't expect to end up in hell - let alone as a slave fighting battles to amuse the rulers of the realm. Then the fateful day arrives when he discovers that his true love, Stella, is also there, wandering alone amid grave danger. </p> <p>He must escape his prison and find her, no matter what evils await him in the wilds of hell. But when he does find her, Drake realizes Stella is no longer the girl he once knew. Hell has hardened her, and she’s on the verge of losing her last shred of humanity. Can he save her from the monster she’s becoming before it's too late?</p> <p>Drake’s mission is clear: He must do everything in his power and more to win Stella back...unless they end up killing each other first!</p> <p><b>Intense. Romantic. Fun. Get lost in the latest action-packed supernatural romance by Elisa S. Amore, a new series that fans of </b><b><i>The 100</i></b><b> and </b><b><i>Hunger Games</i></b><b> will love!</b></p> <p>“The attitude, the heat, the emotion, everything was perfect.” (<i>USA Today</i> best-selling author Ali Winters)</p> <p>Buy now to find out....</p> <p>This is a full-length fantasy/paranormal romance story. It's Upper YA, with adult language and a few non-graphic sex scenes and sexual references.</p>"; 
